import React from "react";
import About from "./About";
import Contact from "./Contact";
import { NavLink } from "react-router-dom";

const Navbar = () =>{


    return (
        <>
             {/* <a style={{ marginLeft: '.1rem' }} href="/"> About  </a>  */}
             {/* <a style={{ marginLeft: '.6rem' }} href="/contact"> Contact  </a> */}
             <br />

            <NavLink to='/' activeClassName='active_class'> About </NavLink>
            <NavLink to='/contact'  activeClassName='active_class' style={{ marginLeft: '.6rem' }}> Contact</NavLink>
            <NavLink to='/contact/name/age'  activeClassName='active_class' style={{ marginLeft: '.6rem' }}> Servies</NavLink>
        </>
    );
};
export default Navbar;
